(3, 'Cơ hội nhận hàng nghìn giải thưởng hấp dẫn với CTKM “Giai điệu cuộc sống” ', '', 'events3.jpg', '\r\n\r\nBạn cảm thấy nhẹ nhàng, thư thái khi nghe nhạc?\r\n\r\nBạn khao khát khám phá cảm xúc con người qua âm nhạc?\r\n\r\nHãy tham gia chương trình khuyến mại “Giai điệu cuộc sống” (09/12/2016 đến 08/03/2017) để lắng nghe trái tim qua những ca khúc, nhịp điệu và có cơ hội nhận nhiều giải thưởng giá trị từ chương trình.  \r\n', '\r\n\r\nBạn cảm thấy nhẹ nhàng, thư thái khi nghe nhạc?\r\n\r\nBạn khao khát khám phá cảm xúc con người qua âm nhạc?\r\n\r\nHãy tham gia chương trình khuyến mại “Giai điệu cuộc sống” (09/12/2016 đến 08/03/2017) để lắng nghe trái tim qua những ca khúc, nhịp điệu và có cơ hội nhận nhiều giải thưởng giá trị từ chương trình.  \r\n', '2017-01-06', '2017-01-06');

