(1, 'Chính sách vận chuyển hàng', 'chinh-sach-van-chuyen-hang', 'news1.jpg', '<p><br></p><p><strong><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">1/ Giao hàng miễn phí</span></strong></p><p><br></p><p><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">1.1/ Giao hàng miễn phí 20 km áp dụng với đơn hàng từ 500.000 vnđ trở lên.</span></p><p><br></p><p><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">1.2/ Thời gian đáp ứng yêu cầu:</span></p><p><br></p><ul><li><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span lang=\"VI\">T</span>rong 3h dưới 25km</span></li><li><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span lang=\"VI\">T</span>rong 4h với khoảng cách <span style=\"color: #000000;\">từ 25 đến 35km</span></span></li><li><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span lang=\"VI\">Trong 24h với khoảng cách t</span>ừ 35 đến 45km</span></li></ul><p><br></p><p style=\"background: white none repeat scroll 0% 0%;\"><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong><span lang=\"VI\" style=\"color: #222222;\">2/ Giao hàng tính phí</span></strong></span></p><p><br></p><p><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"color: #222222;\">&nbsp; Mức thu phí quá km </span><span lang=\"VI\" style=\"color: #222222;\">áp dụng </span><span style=\"color: #222222;\">với xe máy 6000đ</span><span lang=\"VI\" style=\"color: #222222;\">/ km</span><span style=\"color: #222222;\">, </span><span lang=\"VI\" style=\"color: #222222;\">Áp dụng </span><span style=\"color: #222222;\">Ô tô 10.000đ</span><span lang=\"VI\" style=\"color: #222222;\">/ km.</span></span></p><p><br></p><p><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong>&nbsp;2.1/&nbsp; Áp dụng cho khách lẻ và khách hàng doanh nghiệp</strong></span></p><p><br></p><table style=\"width: 764px; height: 367px;\" border=\"1\"><tbody><tr><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong>Giá Trị Đơn Hàng</strong></span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong>Số Km được Miễn Phí</strong></span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong>Thời gian đáp ứng</strong></span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong>Thu phí</strong></span></td></tr><tr><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"line-height: 115%; color: black;\">200.000 đến 500.000 đ</span></span></td><td>&nbsp;</td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">Giao hàng trong vòng 3h</span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"line-height: 115%; color: black;\">Giao hàng bán kính 15km và thu phí 20.000đ /1 lần giao. Km16 tính 6000đ/km và tối đa 45 km</span></span></td></tr><tr><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"line-height: 115%; color: black;\">500.000 </span><span style=\"line-height: 115%; color: black;\">&nbsp;</span><span style=\"line-height: 115%; color: black;\">đến 1.000.000 đ</span></span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">20 Km</span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">Giao hàng trong vòng</span> 3h</span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"line-height: 115%; color: black;\">Từ km thứ 21 thu phí 6.000/km, giao hàng tối đa 45 km</span></span></td></tr><tr><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"line-height: 115%; color: black;\">&gt;1.000.000 đến 3.000.000 đ</span></span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"line-height: 115%; color: black;\">25km</span></span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">Giao hàng trong vòng</span> 3h</span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"line-height: 115%; color: black;\">Từ km thứ 26 thu phí 6.000/km, giao hàng tối đa 45 km</span></span></td></tr><tr><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"line-height: 115%; color: black;\">&gt; 3.000.000 đ</span></span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"line-height: 115%; color: black;\">35km</span></span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">Giao hàng trong vòng</span> 4h</span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"line-height: 115%; color: black;\">Từ km thứ 36 thu phí 6.000/km, giao hàng tối đa 45 km</span></span></td></tr><tr><td colspan=\"4\"><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"></span> <div style=\"mso-element: frame; mso-element-frame-hspace: 9.0pt; mso-element-wrap: around; mso-element-anchor-vertical: paragraph; mso-element-anchor-horizontal: margin; mso-element-left: center; mso-element-top: -3.65pt; mso-height-rule: exactly;\"><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">- Từ 36 Km đến 45 Km đáp ứng tối đa trong vòng 24h <br></span></div><p><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"line-height: 115%; color: black;\">- Đối với khách hàng vượt quá khoảng cách quy định từ 46km trở lên, áp  dụng phương thức gửi xe khách ( khách hàng chọn xe để gửi ) hoặc chuyển  phát nhanh sau khi đã chuyển khoản, khách hàng thanh toán phí vận chuyển cho bên giao hàng.</span></span></p><p><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"line-height: 115%; color: black;\">- Đối với đơn hàng từ 500.000 đ đến 3000.000 đ mà cồng kềnh cần phải giao bằng ô tô thì miễn phí km như khoảng cách giao hàng xe máy và tính phí  vượt quá km đối với ô tô là 10.000/km</span></span></p></td></tr></tbody></table><p><br></p><p><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">&nbsp;<strong>2.2/ Chính sách Game Net / Đơn hàng số lượng</strong></span></p><p><br></p><table style=\"width: 764px; height: 276px;\" border=\"1\"><tbody><tr><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong>&nbsp; Giá Trị Đơn Hàng</strong></span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong>Số Km được Miễn Phí</strong></span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong>Thời gian đáp ứng</strong></span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong>Thu phí</strong></span></td></tr><tr><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"color: black;\"><span style=\"color: black;\">10 bộ máy tính</span></span></span></td><td><span style=\"font-size: medium; font-family: arial,helvetica,sans-serif; color: black;\">50km</span></td><td><span style=\"font-size: medium; font-family: arial,helvetica,sans-serif; color: black;\">Theo thỏa thuận với khách hàng</span></td><td><span style=\"font-size: medium; font-family: arial,helvetica,sans-serif; color: black;\">Từ km thứ 51 thu phí 10.000/km, giao hàng tối đa 150 km</span></td></tr><tr><td><span style=\"font-size: medium; font-family: arial,helvetica,sans-serif; color: black;\">11-20 bộ máy tính</span></td><td><span style=\"font-size: medium; font-family: arial,helvetica,sans-serif; color: black;\">100km</span></td><td><span style=\"font-size: medium; font-family: arial,helvetica,sans-serif; color: black;\">Theo thỏa thuận với khách hàng</span></td><td><span style=\"font-size: medium; font-family: arial,helvetica,sans-serif; color: black;\">Từ km thứ 101 thu phí 10.000/km, giao hàng tối đa 300 km</span></td></tr><tr><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><span style=\"color: black;\">21-30 bộ</span> máy tính</span></td><td><span style=\"font-size: medium; font-family: arial,helvetica,sans-serif; color: black;\">200km</span></td><td><span style=\"font-size: medium; font-family: arial,helvetica,sans-serif; color: black;\">Theo thỏa thuận với khách hàng</span></td><td><span style=\"font-size: medium; font-family: arial,helvetica,sans-serif; color: black;\">Từ km thứ 201 thu phí 10.000/km, giao hàng tối đa 300 km</span></td></tr><tr><td><span style=\"font-size: medium; font-family: arial,helvetica,sans-serif; color: black;\"><span style=\"color: black;\">31 bộ trở lên</span></span></td><td><span style=\"font-size: medium; font-family: arial,helvetica,sans-serif; color: black;\">300km</span></td><td><span style=\"font-size: medium; font-family: arial,helvetica,sans-serif; color: black;\">Theo thỏa thuận với khách hàng</span></td><td><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">&nbsp;</span></td></tr></tbody></table><p><br></p><p><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">&nbsp;<strong><span lang=\"VI\" style=\"color: #222222;\">3/</span></strong><strong><span style=\"color: #222222;\"> Vận chuyển tính phí theo thỏa thuận:</span></strong></span></p><p><br></p><p><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong><span style=\"color: black;\">-&nbsp;</span></strong><span style=\"color: #222222;\">Áp dụng với khách hàng không thuộc các trường hợp như mục 1.và 2. Nếu có  nhu cầu mua hàng (mà khách ở xa, tỉnh lẻ) thì công ty sẽ chuyển hàng cho khách hàng theo hai hình thức ôtô, đường bưu điện .... và khách hàng sẽ tự chịu cước phí (cước phí theo thảo thuận). Có 2 cách thanh toán cước  phí:</span></span></p><p><br></p><p style=\"background: white none repeat scroll 0% 0%;\"><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong><span style=\"color: #222222;\">Cách 1:&nbsp;</span></strong><span style=\"color: #222222;\">Khách hàng&nbsp;có thể chuyển trực tiếp tiền phí vận chuyển luôn cùng với&nbsp;tiền  hàng vào tài khoản của công ty (Khách hàng ghi rõ chú thích phí vận  chuyển khi chuyển tiền).</span></span></p><p><br></p><p style=\"background: white none repeat scroll 0% 0%;\"><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong><span style=\"text-decoration: underline;\"><span style=\"color: #222222;\">Cách 2</span></span></strong><strong><span style=\"color: #222222;\">:&nbsp;</span></strong><span style=\"color: #222222;\">Khách hàng tự thanh toán tiền cước phí trực tiếp cho ôtô khi nhận hàng.</span></span></p><p><br></p><p style=\"background: white none repeat scroll 0% 0%;\"><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong><span style=\"color: black;\">-&nbsp;</span></strong><span style=\"color: #222222;\">Sau khi kiểm tra có tiền của khách hàng trong tài khoản, chúng tôi sẽ gọi điện tới khách hàng để xác nhận v</span><span lang=\"VI\" style=\"color: #222222;\">à gửi hàng cho khách hàng.</span></span></p><p><br></p><p style=\"text-align: justify; background: white none repeat scroll 0% 0%;\"><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong><span lang=\"VI\">4</span></strong><strong>. TRÁCH NHIỆM VỚI HÀNG HÓA VẬN CHUYỂN<span style=\"color: #666666;\">.</span></strong></span></p><p><br></p><p style=\"text-align: justify; background: white none repeat scroll 0% 0%;\"><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">- Công ty sẽ chịu trách nhiệm với hàng hóa và các rủi ro như mất mát hoặc hư hại của hàng hóa trong suốt quá trình vận chuyển hàng từ kho hàng  chúng tôi đến nơi quý khách chỉ định.</span></p><p><br></p><p style=\"text-align: justify; background: white none repeat scroll 0% 0%;\"><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">- Quý khách có trách nhiệm kiểm tra hàng hóa khi nhận hàng. Khi phát hiện hàng hóa bị hư hại, trầy xước, bể vỡ, m<span lang=\"VI\">ó</span>p méo hoặc sai hàng hóa thì ký xác nhận tình trạng hàng hóa với Nhân viên giao nhận và thông báo ngay cho Bộ phận chăm sóc khách hàng theo số  hotline của Công ty<span lang=\"VI\"> (Hotline 097.858.0088)</span></span></p><p><br></p><p style=\"text-align: justify; background: white none repeat scroll 0% 0%;\"><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\">- Sau khi qúy khách đã ký nhận hàng mà không ghi chú hoặc có ý kiến về  hàng hóa. Công ty không có trách nhiệm với những yêu cầu đổi trả vì hư  hỏng, trầy xước, bể vỡ, m<span lang=\"VI\">ó</span>p méo, sai hàng hóa,… từ quý khách sau này.</span></p><p><br></p><p style=\"text-align: justify; background: white none repeat scroll 0% 0%;\"><span style=\"font-family: arial,helvetica,sans-serif; font-size: medium;\"><strong>5. CÁC ĐIỀU KIỆN KHÁC</strong></span></p><p><br></p><p style=\"text-align: justify; background: white none repeat scroll 0% 0%;\"><span style=\"font-family: arial,helvetica,sans-serif; background: white none repeat scroll 0% 0%; font-size: medium;\">- Nếu địa chỉ giao hàng không rõ ràng, nằm trong ngõ ngách, hoặc ở những  nơi nguy hiểm, những vùng đồi núi hiểm trở, phương tiện giao thông đi  lại khó khăn, chúng tôi có quyền từ chối vận chuyển, giao nhận hàng trực tiếp.</span></p><p><br></p>', 'Công văn chấp thuận thoái vốn tại NHTMCP Đông Nam Á', '2017-01-05', '2017-05-20', 0);
INSERT INTO `news` (`id`, `title`, `titlekd`, `img`, `content`, `sum`, `created_at`, `updated_at`, `news_category_id`) VALUES
(2, 'Hướng dẫn mua online', 'huong-dan-mua-online', 'news2.jpg', '<p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Quý khách có 3 cách để mua hàng trực tuyến</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;<strong><span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Cách 1: Đặt hàng qua điện thoại</span></strong></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;<span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">- Quý khách gọi đến số<span style=\"color: rgb(255, 0, 0);\">&nbsp;<strong>0968300660 </strong></span></span><span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">để gặp nhân viên bán hàng Online của chúng tôi. Nhân viên bán hàng Online sẽ tư vấn và tiếp nhận đơn hàng cho quý khách trong thời gian từ 8h-17h30 hàng ngày và tất cả các ngày trong tuần.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;<span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">- Với những đơn hàng ngoài giờ hành chính sẽ được xử lý vào hôm sau, hoặc quý khách có thể gọi vào số&nbsp;<span style=\"font-size: 13pt;\"><span style=\"color: rgb(255, 0, 0);\"><strong>0968300660&nbsp;</strong></span></span><span style=\"color: black;\">để được giải quyết</span></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;<strong><span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Cách 2: Đặt hàng qua phần mềm Chat trên website<br></span></strong></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;<span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">- Quý khách truy cập vào website:<strong>http://trachanh9.esy.es/</strong>&nbsp;để chat và đặt hàng qua phần mềm chat hiển thị ngay góc bên phải chân trang web. Nhân viên Online sẽ tư vấn và xác nhận đơn hàng của quý khách.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><img style=\"width: 339px;\" src=\"data:image/png;base64,\" data-filename=\"chating.PNG\">&nbsp;</p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><b><br></b></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><br></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;<strong><span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Bước 2: Đặt hàng</span></strong></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;<span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">- Khi đã chọn được sản phẩm ưng ý quý khách bấm vào sản phẩm đó để xem chi tiết thông tin sản phẩm, Tiếp theo quý khách sẽ có 2 lựa chọn là “&nbsp;<span style=\"color: red;\">Mua Ngay”&nbsp;</span>hoặc “<span style=\"color: red;\">Cho vào giỏ”</span>. Nếu tiếp tục mua hàng quý khách nhấn nút&nbsp;<span style=\"color: red;\">“Cho vào giỏ”</span>. Sản phẩm của bạn sẽ được add vào giỏ hàng, quý khách tiếp tục xem và chọn lựa sản phẩm khác và&nbsp;<span style=\"color: red;\">“Cho vào giỏ hàng”.</span>&nbsp;Quý khách có thể xem giỏ hàng của mình bằng cách nhấn nút&nbsp;<strong><span style=\"color: red;\">Giỏ hàng&nbsp;</span></strong>ngay trên thanh toolbar góc phải phía trên cùng của website.&nbsp;</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;<img style=\"width: 991px;\" src=\"data:image/png;base64,\" data-filename=\"FireShot Capture 6 - Ngọc Cường Computer_ - http___trachanh9.esy.es_item_laptop.png\"></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">&nbsp;- Trong giỏ hàng của quý khách có hiển thị thông tin về tên sản phẩm, đơn giá, số lượng cần mua, quý khách có thể thay đổi số lượng cần mua, xóa bỏ mặt hàng không muốn mua</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;<img style=\"width: 991px;\" src=\"data:image/png;base64,\" data-filename=\"FireShot Capture 7 - Ngọc Cường Computer - http___trachanh9.esy.es_gio-hang.png\"></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;&nbsp;<span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Quý khách bấm<span style=\"color: red;\">”Tiếp tục”</span>&nbsp;để thực hiện mua hàng trong giỏ</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;<img style=\"border-width: initial; border-style: none; display: block; margin-left: auto; margin-right: auto;\" alt=\"\" src=\"https://www.hanoicomputer.vn/media/news/3110_mua-hang-truc-tuyen6.jpg\"></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;<span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">- Ở bước này nếu quý khách đã đăng nhập tài khoản thì các thông tin về khách hàng sẽ tự động nạp vào bảng thông tin khách hàng ở phía trên, nếu quý khách chưa đăng nhập tài khoản thì vui lòng điền đầy đủ thông tin.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;<span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">- Khi đã chốt được mặt hàng cần mua, quý khách nhấn nút “<strong><span style=\"color: red;\">Đặt hàng”&nbsp;</span></strong><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 13pt;\">đơn hàng của quý khách sẽ được gửi đến hệ thống website của chúng tôi, hệ thống sẽ tự động gửi lại cho quý khách thông tin đơn hàng vừa đặt của quý khách vào địa chỉ email mà quý khách đã đăng ký</span></span></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;<span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">- Nhân viên kinh doanh Online của chúng tôi sẽ liên hệ với khách hàng trong thời gian sớm nhất để xác nhận đơn hàng và xử lý đơn hàng theo yêu cầu của quý khách</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;<strong><span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">Bước 3: Nhận hàng và thanh toán</span></strong></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;<span style=\"font-size: 13pt; font-family: \" open=\"\" sans\",=\"\" sans-serif;\"=\"\">- Quý khách có thể tham khảo chính sách vận chuyển hàng</span></p>', 'Kế hoạch sản xuất kinh doanh và đầu tư phát triển 05 năm', '2017-01-05', '2017-05-19', 0);
INSERT INTO `news` (`id`, `title`, `titlekd`, `img`, `content`, `sum`, `created_at`, `updated_at`, `news_category_id`) VALUES
(3, 'Hướng dẫn mua trả góp', 'huong-dan-mua-tra-gop', 'news3.jpg', '<p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px; margin-bottom: 0.0001pt;\"><span style=\"font-size: 10pt;\">Khách hàng là công dân Việt Nam tuổi từ&nbsp;21 đến 60 tuổi (riêng đối tượng Sinh Viên từ 18 trở lên) đều có thể tham gia mua hàng trả góp . Các ưu điểm khi mua hàng trả góp</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Lãi suất 2,2% (tính theo dư nợ ban đầu).</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Kỳ hạn vay rộng (06, 09, 12, 18 ,24 tháng).</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Hỗ trợ đối tượng khách hàng có hộ khẩu ngoại tỉnh, Hà Nội đang sinh sống, học tập và làm việc tại Hà Nội.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Đặc biệt hỗ trợ đối tượng đã nghỉ hưu, quân nhân và công an.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><strong><span style=\"font-size: 10pt;\">ĐỐI VỚI KHÁCH HÀNG LÀ SINH VIÊN:</span></strong></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Là công dân Việt Nam đang học tập tại Hà Nội.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Từ 18 tuổi trở lên.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Có người đứng ra bảo lãnh (người bảo lãnh là bố, mẹ, anh, chị, em ruột).</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Mức thu nhập của người đứng ra bảo lãnh từ 1,500,000 vnd trở lên.</span></p><ul type=\"disc\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Nếu là bố, mẹ bảo lãnh: hộ khẩu của bố mẹ ở các tỉnh hoặc ở Hà Nội đều được.</span></li><li class=\"MsoNormal\"><span style=\"font-size: 10pt;\">Nếu là anh, chị, em ruột: phải đang sinh sống, làm việc tại Hà Nội.</span></li></ul><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><strong><span style=\"font-size: 10pt;\">Những giấy tờ cần chuẩn bị:</span></strong></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- CMND photo.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Sổ hộ khẩu &nbsp;photo.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Hóa đơn xác nhận địa chỉ nơi ở của người mua hàng.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Thẻ sinh viên photo.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- CMND của người đứng ra bảo lãnh.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><strong><span style=\"text-decoration-line: underline;\"><span style=\"font-size: 10pt;\">Chú ý:</span></span></strong></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Sinh viên ngoại tỉnh đang học tập tại Hà Nội được ưu tiên hỗ trợ mua trả góp.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Người bảo lãnh không cần đến ký nhận giấy tờ (thuận tiện cho đối tượng có người bảo lãnh đang cư trú ở các tỉnh xa Hà Nội).</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Nếu vay trên 10 triệu,&nbsp; người đứng ra bảo lãnh phải cung cấp giấy tờ chứng minh thu nhập (giấy tờ rất đơn giản).</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Tất cả giấy tờ là bản photo không cần công chứng.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Hóa đơn xác nhận địa chỉ nơi ở của người mua hàng: hóa đơn tiền điện, hóa đơn tiền nước, hóa đơn tiền inteet, hóa đơn truyền hình cáp, hóa đơn điện thoại di động trả sau, giấy tạm trú …</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><strong><span style=\"font-size: 10pt;\">ĐỐI VỚI KHÁCH HÀNG LÀ NGƯỜI ĐÃ ĐI LÀM:</span></strong></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Là công dân Việt Nam đang làm việc tại Hà Nội.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Từ 21 – 60 tuổi.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Thu nhập từ 1,500,000 vnd trở lên.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><strong><span style=\"font-size: 10pt;\">Những giấy tờ cần chuẩn bị:</span></strong></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- CMND photo.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Sổ hộ khẩu &nbsp;photo.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Hóa đơn xác nhận địa chỉ nơi ở của người mua hàng.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><strong><span style=\"text-decoration-line: underline;\"><span style=\"font-size: 10pt;\">Chú ý:</span></span></strong></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Người đi làm có hộ khẩu ở Hà Nội hoặc ngoại tỉnh và đang làm việc tại Hà Nội cũng được hỗ trợ. Đặc biệt hỗ trợ đối tượng Công An, Bộ Đội, Giáo Viên …</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Nếu số tiền vay trên 10 triệu, người mua phải chứng minh thu nhập (giấy tờ rất đơn giản)</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Tất cả giấy tờ là bản photo không cần công chứng.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Hóa đơn xác nhận địa chỉ nơi ở của người mua hàng: hóa đơn tiền điện, hóa đơn tiền nước, hóa đơn tiền inteet, hóa đơn truyền hình cáp, hóa đơn điện thoại di động trả sau, giấy tạm trú …</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><strong><span style=\"font-size: 10pt;\">ĐỐI VỚI KHÁCH HÀNG LÀ CHỦ HỘ KINH DOANH:</span></strong></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Là công dân Việt Nam đang kinh doanh tại Hà Nội dưới hình thức cửa hàng hoặc công ty.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Từ 21 – 60 tuổi.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Thu nhập từ 1,500,000 vnd trở lên.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><strong><span style=\"font-size: 10pt;\">Những giấy tờ cần chuẩn bị:</span></strong></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- CMND photo.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Sổ hộ khẩu photo.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Hóa đơn xác nhận địa chỉ nơi ở của người mua hàng.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Giấy phép đăng ký kinh doanh photo.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><strong><span style=\"text-decoration-line: underline;\"><span style=\"font-size: 10pt;\">Chú ý:</span></span></strong></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Chủ hộ kinh doanh có hộ khẩu ở Hà Nội hoặc Ngoại tỉnh và đang kinh doanh tại Hà Nội cũng được hỗ trợ.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Nếu số tiền vay trên 10 triệu, người mua phải chứng minh thu nhập (giấy tờ rất đơn giản).</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Tất cả giấy tờ là bản photo không cần công chứng.</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 10pt;\">- Hóa đơn xác nhận địa chỉ nơi ở của người mua hàng: hóa đơn tiền điện, hóa đơn tiền nước, hóa đơn tiền inteet, hóa đơn truyền hình cáp, hóa đơn điện thoại di động trả sau, giấy tạm trú …</span></p><p class=\"MsoNormal\" style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><br></p>', 'Báo cáo quyết toán 6 tháng đầu năm 2016', '2017-01-05', '2017-05-20', 0),
(4, 'Quy định về đổi, trả lại hàng', 'quy-dinh-ve-doi-tra-lai-hang', 'news4.jpg', '<p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\"><strong>1/ Định nghĩa nhập lại:</strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\">Nhập lại là việc Công ty Cổ Phần Máy Tính Ngoc Cuong nhận lại hàng hóa đã bán cho khách hàng và thanh toán tiền hoặc đổi hàng hóa khác có giá trị tương đương hoặc có giá trị chênh lệch cho khách hàng đó.<br><strong>2. Điều kiện nhập lại hàng:</strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\"><strong><img width=\"900\" style=\"border-width: initial; border-style: none; display: block; margin-left: auto; margin-right: auto;\" alt=\"\" src=\"https://www.hanoicomputer.vn/media/news/1304_Do-hoa-tra-hang-bao-hanh-1.jpg\"></strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\"><strong>&nbsp;</strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\">- Hàng hóa đã mua trong vòng&nbsp;03 ngày&nbsp;tính đến thời điểm nhập lại của khách hàng (<strong>không áp dụng với Laptop)</strong>, khi nhập lại khách hàng được hoàn trả lại tiền.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\">- Sau&nbsp;03 ngày, khách hàng chỉ được trả lại hàng hoặc đổi sang mặt hàng khác khi:</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\">+&nbsp;Đối với các sản phẩm đã mua trong vòng 15 ngày:&nbsp;Hàng bị lỗi không phải nguyên nhân từ phía khách hàng, đã được Công ty khắc phục nhưng không có kết quả hoặc được nhận bảo hành với thời gian quá với quy chế được Trung tâm bảo hành của Công ty xác nhận.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\">+ Đối với các sản phẩm đã mua ngoài thời hạn 15 ngày việc nhập lại hoặc đổi sang mặt hàng khác với chi phí và cách thức được thỏa thuận với khách hàng sẽ do Giám đốc Trung tâm bảo hành quyết định.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\">&nbsp;- Hàng nhập lại phải đảm bảo các yếu tố sau:</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\">+ Hàng nhập lại phải sạch sẽ, còn nguyên tem, Serial, phiếu bảo hành, nguyên hình dạng, không xước, biến dạng, cháy nổ…</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\">+ Hàng phải còn đầy đủ vỏ hộp, sách hướng dẫn, đĩa cài đặt (nếu có) và các phụ kiện đi kèm.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\"><span style=\"color: rgb(255, 0, 0);\"><strong>Ghi chú:</strong></span><strong><em>&nbsp;Khách hàng vui lòng mang sản phẩm cần nhập lại qua nơi mua để được giải quyết theo quy định.</em></strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;</p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\"><strong><img width=\"900\" style=\"border-width: initial; border-style: none; display: block; margin-left: auto; margin-right: auto;\" alt=\"\" src=\"https://www.hanoicomputer.vn/media/news/1304_Do-hoa-tra-hang-bao-hanh2.jpg\"></strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;</p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\"><strong>3. Giá nhập lại hoặc đổi lại:</strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\">&nbsp;</p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\">- Hàng mua trong vòng&nbsp;03 ngày&nbsp;kể từ ngày mua hàng sẽ được nhập lại theo giá tại thời điểm trả lại hàng (tính theo báo giá linh kiện của Công ty). Trường hợp giá tại thời điểm nhập lại cao hơn giá thời điểm khách mua hàng thì giá nhập lại được căn cứ vào giá tại thời điểm mua hàng.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\">- Giá hàng hóa nhập đổi cũng được tính theo nguyên tắc nêu trên.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\">- Trường hợp tại thời điểm nhập lại hàng mà loại hàng đó không có trên thị trường hoặc không định được giá của mặt hàng đó thì sẽ cùng thỏa thuận một mức giá hợp lý, cùng căn cứ mức giá này để tính toán.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\">- Những trường hợp đặc biệt về nhập lại hàng hóa&nbsp;mà Giám đốc Trung tâm bảo hành không quyết định được&nbsp;sẽ do Tổng Giám đốc quyết định.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\"><strong>4. Thủ tục nhập lại</strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\">- Bắt buộc khách hàng phải xuất trình phiếu xuất kho tại Kho và hóa đơn tài chính (nếu có) của mặt hàng cần nhập lại.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: medium;\">- Trường hợp sản phẩm đã được Công ty Cổ phần Máy Tính&nbsp;Ngoc Cuong&nbsp;viết hóa đơn tài chính, khách hàng muốn trả lại hàng phải viết trả lại hoá đơn tài chính hoặc làm thủ tục hủy hóa đơn này theo quy định của pháp luật.</span></p>', 'Báo cáo chế độ tiền lương, tiền thưởng năm 2015', '2017-01-05', '2017-05-20', 0),
(5, 'Chính sách bảo hành', 'chinh-sach-bao-hanh', 'news6.jpg', '<p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium;\"><strong><span style=\"font-family: arial, helvetica, sans-serif;\">I.&nbsp;Chính&nbsp;sách&nbsp;bảo&nbsp;hành&nbsp;(Áp dụng cho khách hàng sử dụng cuối):</span></strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">&nbsp;<strong>1. Đối với laptop, màn hình và linh kiện:</strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">- &nbsp;Được đổi ngay sản phẩm mới 100% trong vòng 15 ngày đầu sau khi mua hàng (sản phẩm phải có đầy đủ vỏ hộp, phụ kiện kèm theo và không bị trầy xước và không phải là sản phẩm tiêu hao).</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">- Cam kết khắc phục sự cố và trả hàng bảo hành trong thời gian 7 ngày&nbsp;(không tính thứ 7, chủ nhật, các ngày lễ, tết &nbsp;và các trường hợp khác được thỏa thuận trước)&nbsp;cho các sản phẩm đã mua từ ngày thứ 16 cho đến khi hết thời hạn&nbsp;bảo&nbsp;hành.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\"><br></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium;\"><strong><span style=\"font-family: arial, helvetica, sans-serif;\">2. Những trường hợp&nbsp;bảo&nbsp;hành&nbsp;muộn hơn so với quy định:</span></strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">- Trong trường hợp thời gian trả&nbsp;bảo&nbsp;hành&nbsp;muộn hơn thời gian quy định thì chúng tôi sẽ cộng thêm vào thời hạn&nbsp;bảo&nbsp;hành&nbsp;sản phẩm của Quý khách thời gian tương ứng với thời gian chậm trả cho khách hàng.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">- Các sản phẩm được&nbsp;bảo&nbsp;hành&nbsp;theo quy định của hãng, của nhà cung cấp mà&nbsp;bảo&nbsp;hành&nbsp;lâu thì Trung tâm Bảo hành có trách nhiệm đảm&nbsp;bảo&nbsp;luôn đôn đốc hãng trả&nbsp;bảo&nbsp;hành&nbsp;trong thời gian sớm nhất cho Quý khách hàng và liên lạc với khách hàng ngay khi hãng trả&nbsp;bảo&nbsp;hành. Quý khách có thể được mượn một thiết bị tương đương trong thời gian chờ&nbsp;bảo&nbsp;hành (nếu có sẵn hàng cho mượn).</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">Trường hợp không&nbsp;bảo&nbsp;hành&nbsp;được hoặc thời gian&nbsp;bảo&nbsp;hành&nbsp;quá lâu, Quý khách có thể chọn lựa một trong các phương án sau:</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Đổi sang thiết bị khác tương đương hoặc có cấu hình cao hơn với chi phí thỏa thuận.</span><br><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; + Nhập lại sản phẩm theo giá thỏa thuận.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">&nbsp;<em>Lưu ý:</em></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\"><em>&nbsp; &nbsp; &nbsp; &nbsp;&nbsp; &nbsp; -&nbsp;</em>Chính&nbsp;sách&nbsp;<em>trên chỉ áp dụng với sản phẩm bị lỗi do hãng sản xuất và đủ điều kiện</em>&nbsp;bảo&nbsp;hành<em>.</em></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;- &nbsp;Công ty Cổ Phần Máy tính Hà Nội không</em>&nbsp;bảo&nbsp;hành&nbsp;<em>và không chịu trách nhiệm về dữ liệu và tính hợp pháp của các phần mềm, dữ liệu hiện có trong sản phẩm của khách hàng. Quý khách hàng vui lòng lưu lại dữ liệu của mình trước khi gửi</em>&nbsp;bảo&nbsp;hành<em>.</em></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><em><br></em></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><em>&nbsp;</em><strong>II. Điều kiện bảo hành:</strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">&nbsp;1. Những trường hợp sau đây sẽ không được bảo hành:</span><br><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Thiết bị không có phiếu bảo hành, phiếu bảo hành&nbsp; đã bị sửa đổi thông tin, bị chắp nối, rách nát.</span><br><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Các thiết bị không còn nguyên tem bảo hành và mã vạch của hãng sản xuất, nhà phân phối và của Công ty Cổ Phần Máy Tính Hà Nội.</span><br><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Sử dụng điện áp sai quy định, quá công suất của thiết bị hoặc bị cháy nổ, rơi vỡ, móp, nứt, thủng, trầy xước…</span><br><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Hư hỏng do thiên tai, động vật, côn trùng và con người gây ra.</span><br><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Các phụ kiện tiêu hao.</span><br><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Tất cả các lỗi về phần mềm.</span><br><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Hết thời hạn bảo hành ghi trên phiếu.</span><br><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; + Khách hàng tự ý can thiệp vào BIOS.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\"><br></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\">&nbsp;2. Các trường hợp khác sẽ được bảo hành theo tiêu chuẩn của hãng sản xuất.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong>III. Chính sách ưu đãi:</strong></span><br><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Những linh kiện hết thời gian bảo hành hoặc không đủ điều kiện bảo hành, chúng tôi sẽ tạo điều kiện hỗ trợ tới mức tối đa.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">- Khách hàng lẻ khi đến gửi hàng bảo hành tại trung tâm bảo hành được lựa chọn 1 trong 2 hình thức nhận hàng:</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">+ Tại nơi sử dụng hoặc tại nơi gửi hàng:Trung tâm Bảo hành sẽ&nbsp;có trách nhiệm đem trả hàng bảo hành (sau khi đã xử lý xong) tại nơi khách hàng sử dụng hoặc nơi khách hàng đăng ký (trong vòng bán kính 20 km tính từ trung tâm bảo hành).</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">+ Tại Trung tâm Bảo hành của Công ty: Quy trình nhận, trả hàng vẫn theo quy định hiện hành.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><br></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong>IV. Địa điểm bảo hành:</strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><b>Trung Tâm Bảo Hành Công ty Cổ Phần Máy Tính&nbsp;Ngọc Cường&nbsp;– </b><font color=\"#ff0000\">Tổ 10, Sông Công, Thái Nguyên</font></span><br><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><span data-mce-mark=\"1\"><strong>Điện thoại:&nbsp;&nbsp;<strong>0968300660</strong></strong></span></span><br><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">Email:&nbsp;<a style=\"font-size: initial; cursor: pointer;\" target=\"_blank\"><font color=\"#222222\">ngotai94@gm</font></a>ail.com&nbsp;</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\">*&nbsp;<span style=\"color: rgb(255, 0, 0);\">Tra cứu thông tin bảo hành</span>:<strong>&nbsp;0968300660</strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><strong>* Khiếu nại về bảo hành:&nbsp;<strong>0968300660</strong></strong></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\" data-mce-mark=\"1\"><span data-mce-mark=\"1\"><strong>Trung Tâm Bảo Hành</strong></span>&nbsp;làm việc liên tục từ 8h đến 19h tất cả các ngày trong tuần ( Ngày&nbsp;<span style=\"color: rgb(255, 0, 0);\">Chủ Nhật&nbsp;<span data-mce-mark=\"1\">từ 8h đến 17h30</span></span>), mọi đóng góp ý kiến về chất lượng sản phẩm hoặc dịch vụ bảo hành của Công ty, Quý khách vui lòng liên hệ số điện thoại chăm sóc khách hàng:&nbsp;<a style=\"font-size: initial; cursor: pointer;\" href=\"tel:04.36280886\" target=\"_blank\"><u><font color=\"#0066cc\">0968300660</font></u></a>&nbsp;&nbsp;hoặc Email:&nbsp;</span><a target=\"_blank\"><font color=\"#222222\">ngotai94@gmail.com</font></a></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: medium; font-family: arial, helvetica, sans-serif;\"><strong>Cảm ơn Quý khách đã sử dụng dịch vụ của chúng tôi</strong></span></p>', 'Báo cáo tình hình sắp xếp, đổi mới doanh nghiệp năm 2015', '2017-01-05', '2017-05-20', 0);
