(7, 'Quy định chung', 'quy-dinh-chung', 'lG5k_baner.png', '<p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px; margin: 0in 0in 0.0001pt;\"><strong><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">I. Chính sách chung</span></strong></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px; margin: 0in 0in 0.0001pt;\"><strong><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">1. Chấp thuận các Điều kiện Sử dụng</span></strong></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px; margin: 0in 0in 0.0001pt;\"><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">Khi sử dụng Website của&nbsp;<span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><strong><strong>NGOCCUONGCOMPUTE</strong>R</strong></span>&nbsp;, Quý khách đã mặc nhiên chấp thuận các điều khoản và điều kiện sử dụng được quy định dưới đây. Để biết được các sửa đổi mới nhất, Quý khách nên thường xuyên kiểm tra lại “Điều kiện Sử dụng”.&nbsp;<span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><strong><strong>NGOCCUONGCOMPUTE</strong>R</strong></span>&nbsp;có quyền thay đổi, điều chỉnh, thêm hay bớt các nội dung của “Điều kiện Sử dụng” tại bất kỳ thời điểm nào. Nếu Quý khách vẫn tiếp tục sử dụng Website sau khi có các thay đổi như vậy thì có nghĩa là Quý khách đã chấp thuận các thay đổi đó.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px; margin: 0in 0in 0.0001pt;\"><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">&nbsp;</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px; margin: 0in 0in 0.0001pt;\"><strong><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">2. Tính chất của thông tin hiển thị</span></strong></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px; margin: 0in 0in 0.0001pt;\"><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">Các nội dung hiển thị trên Website nhằm mục đích cung cấp thông tin về&nbsp;<span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><strong><strong>NGOCCUONGCOMPUTE</strong>R</strong></span>, về thông tin sản phẩm và dịch vụ mà mà&nbsp;<span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><strong><strong>NGOCCUONGCOMPUTE</strong>R</strong></span></span>&nbsp;đang cung cấp. Các thông tin khác liên quan nhằm phục vụ nhu cầu tìm hiểu của khách hàng đều được ghi rõ nguồn cung cấp.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px; margin: 0in 0in 0.0001pt;\"><strong><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\"><a style=\"font-size: initial; cursor: pointer;\" href=\"https://www.hanoicomputer.vn/bao-mat-thong-tin-khach-hang/a563.html\" target=\"_blank\">3. Chính sách về bảo mật thông tin</a></span></strong></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><strong><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">4. Liên kết đến Website khác</span></strong></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">Website cung cấp một số liên kết tới trang Web hoặc nguồn dữ liệu khác. Quý khách tự chịu trách nhiệm khi sử dụng các liên kết này.&nbsp;<span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><strong><strong>NGOCCUONGCOMPUTE</strong>R</strong></span>không tiến hành thẩm định hay xác thực nội dung, tính chính xác, quan điểm thể hiện tại các trang Web và nguồn dữ liệu liên kết này.&nbsp;<span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><strong><strong>NGOCCUONGCOMPUTE</strong>R</strong></span>&nbsp;từ chối bất cứ trách nhiệm pháp lý nào liên quan tới tính chính xác, nội dung thể hiện, mức độ an toàn và việc cho hiển thị hay che đi các thông tin trên các trang Web và nguồn dữ liệu nói trên.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><strong><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">5. Liên kết từ Website khác</span></strong></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\"><span style=\"font-size: 13pt;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><strong><strong>NGOCCUONGCOMPUTE</strong>R</strong></span></span></span>&nbsp;không cho phép bất kỳ nhà cung cấp dịch vụ internet nào được phép “đặt toàn bộ” hay “nhúng” bất kỳ thành tố nào của Website này sang một trang khác hoặc sử dụng các kỹ thuật làm thay đổi giao diện / hiển thị mặc định của Website mà chưa có sự đồng ý của&nbsp;<span style=\"font-size: 13pt;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\">HANOICOMPUTER</span></span><br></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><strong><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">6. Miễn trừ trách nhiệm</span></strong></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><strong><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">&nbsp;</span></strong><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">Thông tin hiển thị tại website này không đi kèm bất kỳ đảm bảo hay cam kết trách nhiệm từ phía&nbsp;<span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><strong><strong>NGOCCUONGCOMPUTE</strong>R</strong></span>&nbsp;về sự phù hợp của sản phẩm, dịch vụ mà người mua đã lựa chọn</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\"><span style=\"font-size: 13pt;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><strong><strong>NGOCCUONGCOMPUTE</strong>R</strong></span></span></span>&nbsp;từ chối trách nhiệm hay đưa ra đảm bảo rằng website sẽ không có lỗi vận hành, an toàn, không bị gián đoạn hay tính chính xác, đầy đủ và đúng hạn của các thông tin hiển thị</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">Khi truy cập vào website này, quý khách mặc nhiên đồng ý rằng&nbsp;<span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><strong><strong>NGOCCUONGCOMPUTE</strong>R</strong></span>, các nhà cung cấp khác cùng với đối tác liên kết, nhân viên của họ không chịu bất cứ trách nhiệm nào liên quan đến thương tật, mất mát, khiếu kiện, thiệt hại trực tiếp hoặc gián tiếp do không lường trước hoặc do hậu quả để lại dưới bất cứ hình thức nào phát sinh từ việc:</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">(1) Sử dụng các thông tin trên website này; (2) các truy cập kết nối từ website này; (3) Đăng ký thành viên, đăng ký nhận thư điện tử hay tham gia vào chương trình khách hàng thường xuyên của&nbsp;<span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><strong><strong>NGOCCUONGCOMPUTE</strong>R</strong></span><br></span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">Các điều kiện và hạn chế nêu trên chỉ có hiệu lực trong khuôn khổ pháp luật hiện hành.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><strong><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">7. Quyền sở hữu trí tuệ</span></strong></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">Website này và mọi nội dung xếp đặt, hiển thị đều thuộc sở hữu và là tài sản độc quyền khai thác của&nbsp;<span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><strong><strong>NGOCCUONGCOMPUTE</strong>R </strong></span>và các nhà cung cấp có liên quan khác. Mọi sử dụng, trích dẫn phải không gây thiệt hại cho&nbsp;<span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><strong><strong>NGOCCUONGCOMPUTE</strong>R</strong></span>&nbsp;và đều phải tuân thủ các điều kiện sau: (1) Chỉ sử dụng cho mục đích cá nhân, phi thương mại; (2) các sao chép hoặc trích dẫn đều phải giữ nguyên dấu hiệu bản quyền hoặc các yết thị về quyền sở hữu trí tuệ như đã thể hiện trong phiên bản gốc; và Tất cả các nội dung được cung cấp tại Website này không được phép nhân bản, hiển thị, công bố, phổ biến, đưa tin tức hay lưu hành cho bất cứ ai, dưới bất kỳ hình thức nào, kể cả trên các Website độc lập khác mà không được sự chấp thuận của<span style=\"font-size: 13pt;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"> <span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><strong><strong>NGOCCUONGCOMPUTE</strong>R</strong></span></span></span>.</span></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><strong><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\">8. Điều chỉnh và sửa đổi</span></strong></p><p style=\"color: rgb(34, 34, 34); font-family: Arial, sans-serif; font-size: 12px;\"><span style=\"font-size: 13pt; font-family: \" sans-serif;\"=\"\" sans\",=\"\" open=\"\"><span style=\"font-size: 13pt;\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><span style=\"font-family: arial, helvetica, sans-serif; font-size: medium; color: rgb(0, 0, 0);\"><strong><strong>NGOCCUONGCOMPUTE</strong>R</strong></span></span></span>&nbsp;bảo lưu quyền thay đổi, chỉnh sửa hoặc chấm dứt hoạt động của Website này vào bất cứ thời điểm nào.</span></p>', 'Quy định chung', '2017-04-04', '2017-05-20', 0),
