(1, 'Giới thiệu Iphone 7+', 'gioi-thieu-iphone-7-', 'ip4K_banner-foreground-iphone-7_avail_banner.jpg', 7, 1, '<p><br></p><h1 class=\"modal-title\">Đánh giá chi tiết iPhone 7 Plus <br></h1><p>   <br></p><h2 style=\"text-align: justify;\"><span style=\"font-size:14px;\">Với những tính năng vượt trội về camera, <a href=\"https://fptshop.com.vn/dien-thoai/iphone-7-plus-128gb\" target=\"_blank\">iPhone 7 Plus </a>\r\n là sản phẩm nổi bật còn hơn cả iPhone khi cùng ra mắt, khả năng chụp \r\nảnh zoom 10x với camera kép và chụp chân dung xoá phông đã thuyết phục \r\nngười dùng một cách ngọt ngào nhất. Không chỉ vậy, nâng cấp về cấu hình,\r\n âm thanh, thiết kế tinh tế hơn và phiên bản bộ nhớ lên đến 128 GB cũng \r\nkhiến đây là sản phẩm đáng mua nhất trong lần ra mắt loạt phiên bản mới \r\ncủa Apple.</span></h2><h3 style=\"text-align: justify;\"><strong><span style=\"font-size:14px;\">Thiết kế hoàn thiện hơn</span></strong></h3><p>\r\n\r\n<br></p><p style=\"text-align: justify;\"><img alt=\"iphone-7-plus-128gb\" longdesc=\"iphone-7-plus-128gb\" src=\"https://fptshop.com.vn/Uploads/images/2015/San-pham/iphone-7-plus-128gb/iphone-7-plus-128gb/iphone-7-plus-128gb-3.jpg\" style=\"width: 751.098px; height: 430.317px;\" title=\"iphone-7-plus-128gb\"></p><p>\r\n\r\n<br></p><p style=\"text-align: justify;\"> </p><p style=\"text-align: justify;\"><span style=\"font-size:14px;\">Về thiết \r\nkế, vẫn là nhôm nguyên khối liền lạc nhưng iPhone 7 Plus đã có những nét\r\n thay đổi tinh tế khi đưa hai dải ăng-ten lên sát hai cạnh trên dưới, \r\nđồng thời bỏ đi jack cắm tai nghe 3.5 mm. Điểm nhấn ấn tượng nhất về \r\nngoại hình của iPhone 7 Plus là việc Apple bỏ đi màu xám không gian từng\r\n rất được ưa chuộng trên các model cũ để bổ sung thêm tùy chọn màu đen \r\nmờ và đen bóng Jet Black (chỉ có trên iPhone 7 Plus bản 128/256 GB).</span></p><h3 style=\"text-align: justify;\"><strong><span style=\"font-size:14px;\">Màn hình rộng 5.5 inch, sáng hơn, nhiều màu sắc hơn</span></strong></h3><p>\r\n\r\n<br></p><p style=\"text-align: justify;\"><span style=\"font-size:14px;\"><img alt=\"iphone-7-plus-128gb\" longdesc=\"iphone-7-plus-128gb\" src=\"https://fptshop.com.vn/Uploads/images/2015/San-pham/iphone-7-plus-128gb/iphone-7-plus-128gb/iphone-7-plus-128gb-9.jpg\" style=\"width: 676.538px; height: 387.6px;\" title=\"iphone-7-plus-128gb\"></span></p><p>\r\n\r\n<br></p><p style=\"text-align: justify;\"><span style=\"font-size:14px;\">iPhone 7 \r\nPlus cũng có màn hình 5.5 inch độ phân giải 1080x1920 pixels tương tự \r\niPhone 6s Plus, như vậy về kích thước tổng thể chúng ta không có gì thay\r\n đổi. Tuy nhiên, tấm nền màn hình mới đã được bổ sung thêm 25% độ sáng, \r\nđạt mức cao nhất 625 nits cùng khả năng tái tạo màu sắc, gam màu rộng \r\nhơn và hỗ trợ 3D Touch.</span></p><h3 style=\"text-align: justify;\"><strong><span style=\"font-size:14px;\">Nút Home hoàn toàn mới</span></strong></h3><p>\r\n\r\n<br></p><p style=\"text-align: justify;\"><span style=\"font-size:14px;\"><img alt=\"iphone-7-plus-128gb\" longdesc=\"iphone-7-plus-128gb\" src=\"https://fptshop.com.vn/Uploads/images/2015/San-pham/iphone-7-plus-128gb/iphone-7-plus-128gb/iphone-7-plus-128gb-6.jpg\" style=\"width: 678.284px; height: 388.6px;\" title=\"iphone-7-plus-128gb\"></span></p><p>\r\n\r\n<br></p><p style=\"text-align: justify;\"><span style=\"font-size:14px;\">Với chiếc \r\nđiện thoại thế hệ mới, Apple đã \"xoá sổ\" hoàn toàn nút bấm vật lý trên \r\nmàn hình iPhone. Giờ đây nút Home ở vị trí cũ đã trở thành cảm ứng, khi \r\nbạn nhấn xuống nó vẫn cảm nhận được lực nhấn và sẽ rung nhẹ để bạn biết \r\nrằng bạn đã tương tác. Apple đã sử dụng Taptic Engine trên Force Touch \r\ncủa Macbook cho chiếc iPhone mới này. Mặc dù vậy phím Home vẫn có cảm \r\nbiến vân tay Touch ID và tích hợp nhiều tính năng bảo mật.</span></p><h3 style=\"text-align: justify;\"><strong><span style=\"font-size:14px;\">Camera chất lượng đột phá như máy ảnh chuyên nghiệp</span></strong></h3><p>\r\n\r\n<br></p><p style=\"text-align: justify;\"><img alt=\"iphone-7-plus-128gb\" longdesc=\"iphone-7-plus-128gb\" src=\"https://fptshop.com.vn/Uploads/images/2015/San-pham/iphone-7-plus-128gb/iphone-7-plus-128gb/iphone-7-plus-128gb-5.jpg\" style=\"width: 678.284px; height: 388.6px;\" title=\"iphone-7-plus-128gb\"></p><p>\r\n\r\n<br></p><p style=\"text-align: justify;\"><span style=\"font-size:14px;\">iPhone 7 \r\nPlus đi kèm với một camera kép độ phân giải đồng thời 12 MP, trong số đó\r\n có một ống kính góc rộng khẩu độ lên đến f/1.8 và một ống kính zoom \r\n(tele) lên đến 10x, cùng tính năng ổn định hình ảnh quang học tự \r\nđộng. Nó cũng bao gồm một đèn flash 2 tông màu và đèn flash quad-LED. \r\nCamera hỗ trợ quay film 4K 60fps, chụp xóa phông, chụp trước lấy nét sau\r\n như một máy ảnh chuyên nghiệp. Camera trước độ phân giải 7 MP, chụp \r\nselfie tốt hơn và tự động chống rung. Bên cạnh đó, iOS 10 cũng cho phép \r\nngười dùng iPhone 7 Plus chỉnh sửa, chọn lựa ảnh từ Live Photos, lưu ảnh\r\n ở định dạng RAW.</span></p><p>\r\n\r\n<br></p><h3 style=\"text-align: justify;\"><strong><span style=\"font-size:14px;\">Tính năng chống nước tiện lợi</span></strong></h3><p>\r\n\r\n<br></p><p style=\"text-align: justify;\"><img alt=\"iphone-7-plus-128gb\" longdesc=\"iphone-7-plus-128gb\" src=\"https://fptshop.com.vn/Uploads/images/2015/San-pham/iphone-7-plus-128gb/iphone-7-plus-128gb/iphone-7-plus-128gb-8.jpg\" style=\"width: 683px; height: 391.302px;\" title=\"iphone-7-plus-128gb\"></p><p>\r\n\r\n<br></p><p style=\"text-align: justify;\"><span style=\"font-size:14px;\">Có thể nói\r\n tính năng chống nước là điều làm hài lòng nhất các tín đồ nhà Táo. Với \r\ntiêu chuẩn chống nước IP67 sẽ giúp iPhone mới có thể sống ở độ sâu 1 mét\r\n nước trong 30 phút, vậy là từ nay bạn sẽ quên đi nỗi lo về thấm nước \r\ntrên iPhone 7 Plus khi đi trong trời mưa hay lỡ tay rớt nước.</span></p><h3 style=\"text-align: justify;\"><strong><span style=\"font-size:14px;\">Hiệu năng vượt trội, lưu trữ thoải mái</span></strong></h3><p>\r\n\r\n<br></p><p>\r\n\r\n<br></p><p style=\"text-align: justify;\"><img alt=\"iphone-7-plus-128gb\" longdesc=\"iphone-7-plus-128gb\" src=\"https://fptshop.com.vn/Uploads/images/2015/San-pham/iphone-7-plus-128gb/iphone-7-plus-128gb/iphone-7-plus-128gb-1.jpg\" style=\"width: 682px; height: 390.729px;\" title=\"iphone-7-plus-128gb\"></p><p>\r\n\r\n<br></p><p style=\"text-align: justify;\"><span style=\"font-size:14px;\">iPhone 7 \r\nPlus sử dụng chip A10 Fusion 4 lõi, 64-bit với tốc độ cực nhanh. Apple \r\ncông bố con chip này có hiệu năng xử lý cao hơn 40% so với chip A9 và \r\ngấp 2 lần so với chip A8. Đặc biệt là nó còn cao gấp 120 lần so với \r\niPhone đời đầu. Đi cùng đó là sự nâng cấp về bộ nhớ trong, phiên bản 16 \r\nGB trước đây đã bị loại bỏ, thay vào đó chúng ta sẽ có bộ nhớ trong 128 \r\nGB ở phiên bản này để thoải mái lưu trữ.</span></p><h3 style=\"text-align: justify;\"><strong><span style=\"font-size:14px;\">Âm thanh sống động cùng loa stereo</span></strong></h3><p>\r\n\r\n<br></p><p style=\"text-align: justify;\"><span style=\"font-size:14px;\"><img alt=\"iphone-7-plus-128gb\" longdesc=\"iphone-7-plus-128gb\" src=\"https://fptshop.com.vn/Uploads/images/2015/San-pham/iphone-7-plus-128gb/iphone-7-plus-128gb/iphone-7-plus-128gb-7.jpg\" style=\"width: 679px; height: 389.01px;\" title=\"iphone-7-plus-128gb\"></span></p><p>\r\n\r\n<br></p><p style=\"text-align: justify;\"><span style=\"font-size:14px;\">Loa ngoài \r\ntrên iPhone 7 Plus bất ngờ được nâng cấp khi từ dạng đơn lên loa kép \r\nStereo, với một loa nằm ở cạnh đáy và một nằm ở cạnh trên, cho âm lượng \r\nsống động gấp hai lần trên iPhone 6s Plus.</span></p><p>\r\n\r\n<br></p><p><strong>Tăng thời lượng sử dụng pin</strong></p><p>\r\n\r\n<br></p><p>Theo công bố từ Apple, iPhone 7 Plus có khả năng sử dụng liên tục \r\ntrong thời gian hơn 1 ngày, với 60 giờ lướt web không dây và 13 giờ sử \r\ndụng mạng LTE. Tăng hơn so với iPhone 6s Plus và đảm bảo sử dụng cho cả \r\nngày dài.</p><p><br></p>', 'iPhone 7 cải thiện đáng kể các khía cạnh quan trọng nhất về trải nghiệm iPhone. Hệ thống camera tiên tiến mới.', 0, '1', '2016-12-12', '2017-01-08');

